import React from "react";

function EmployeList({ list, showAlert, empID }) {
  console.log(list);
  console.log(empID);

  const empDept = list.map((emp, index) => (
    <h3 onClick={showAlert} key={index}>
      {emp.department}
    </h3>
  ));

  return <div className="container">{empDept}</div>;
}

export default EmployeList;
